// components/AboutUs.js
import React from 'react';
import { Box, Divider, AbsoluteCenter } from '@chakra-ui/react';

const AboutUs = () => {
    return (
        <Box position='relative' padding='10' mt='150'>
            <AbsoluteCenter px='4'>
                <Divider orientation="horizontal" position="relative">
                    <DividerLine />
                </Divider>
                <Box bg="white" p="4" borderRadius="md">
                    <span style={{ fontFamily: 'Montserrat, sans-serif', fontWeight: 'bold', fontSize: 50, color: 'black' }}>
                        About Us
                    </span>
                </Box>
                <Divider orientation="horizontal" position="relative">
                    <DividerLine />
                </Divider>
            </AbsoluteCenter>
        </Box>
    );
};

const DividerLine = () => {
    return (
        <div style={{ position: 'absolute', top: '50%', left: 0, right: 0, height: '1px', backgroundColor: 'black', zIndex: 1 }}></div>
    );
};

export default AboutUs;
